import { resourceService } from '../axios';

const env = process.env.REACT_APP_BACKEND_ENV === 'dev' ? 'dev' : ''; 

export const getUserProfile = async ({ userID }) => {
    const { data } = await resourceService.get(`${env}/user/details/${userID}`);
    return data;
};
